function ProgressBar({ progressBarRef }) {
  return (
    <div className="progress">
      <span className="time current">00.00</span>
      <input type="range" ref={progressBarRef} />
      <span className="time">03.34</span>
    </div>
  )
}

export default ProgressBar;
